package com.algorithm.contest.weeklycontest278;

public class SubStrHash {
    public static void main(String[] args) {
        String s = "";

        int power = 71717, modulo = 94536, k = 1149, hashValue = 39999;
        System.out.println(subStrHash(s, power, modulo, k, hashValue));
    }

    public static String subStrHash(String s, int power, int modulo, int k, int hashValue) {
        int n = s.length();
        char[] chrs = s.toCharArray();
        int mod = 1;
        int pos = -1;
        int h = 0;
        for (int i = n - 1; i >= n - k; i--) {
            h = (int) (((long) h * power + toNum(chrs[i])) % modulo);
            if (i != n - k) {
                mod = (int) (((long) mod * power * 1l) % modulo);
            }
        }
        if (h == hashValue) {
            pos = n - k;
        }
        for (int i = n - k - 1; i >= 0; --i) {
            int tInd = (int) ((long) toNum(chrs[i + k]) * mod % modulo);
            h = (int) (((long) (h - tInd + modulo) * power + toNum(chrs[i])) % modulo);
            if (h == hashValue) {
                pos = i;
            }
        }
        return s.substring(pos, pos + k);
    }

    public static int toNum(char c) {
        return (int) (c - 'a' + 1);
    }
}
